import request from '@/utils/request';
var url = 'v1/indicators/indSupplementaryReviews';
export function toApprove(ids, infoIds, approveStatus) {
  return request({
    url: url + "/toApprove?ids=" + ids + "&infoIds=" + infoIds + "&approveStatus=" + approveStatus,
    method: 'get'
  });
}
export function add(data) {
  return request({
    url: url,
    method: 'post',
    data: data
  });
}
export function del(ids) {
  return request({
    url: url,
    method: 'delete',
    data: ids
  });
}
export function edit(data) {
  return request({
    url: url,
    method: 'put',
    data: data
  });
}
export default {
  url: url,
  crud: {
    add: add,
    edit: edit,
    del: del
  }
};
